import React from 'react';
import './App.css';
import Nav from './components/navBar/navbar.js';
import Shop from './components/Shop/shop.js';
import {Rout,Route,Routes} from 'react-router-dom'

function app() {

    return (
    <div>
    <Nav />
     <Router>
          <Routes>
            <Route path="/shop" component={Shop}/>
          </Routes>
      </Router>
    </div>  

    );
}


export default app;
